    rateLimit {
        cost
        limit
        nodeCount
        remaining
        resetAt
        used
    }
    user(login:$username){
        login
        name
        contributionsCollection(from:$since, to:$until){
            startedAt
            endedAt
            hasAnyContributions

            totalCommitContributions
            totalIssueContributions
            totalPullRequestContributions
            totalPullRequestReviewContributions

            totalRepositoriesWithContributedCommits
            totalRepositoriesWithContributedIssues


            commitContributionsByRepository(maxRepositories:100){
                repository{
                    owner{
                        login
                    }
                    nameWithOwner
                    url
                }
                url
                contributions(first:100){
                    pageInfo{
                        hasNextPage
                    }
                    totalCount
                }
            }
            issueContributionsByRepository(maxRepositories:100){
                repository{
                    owner{
                        login
                    }
                    nameWithOwner
                    url
                }
                contributions(first:100){
                    pageInfo{
                        hasNextPage
                    }
                    totalCount
                    nodes{
                        issue{
                            number
                        }
                    }
                }
            }
            pullRequestContributionsByRepository(maxRepositories:100){
                repository{
                    owner{
                        login
                    }
                    nameWithOwner
                    url
                }
                contributions(first:100){
                    pageInfo{
                        hasNextPage
                    }
                    totalCount
                    nodes{
                        pullRequest{
                            number
                        }
                    }
                }
            }
            pullRequestReviewContributionsByRepository(maxRepositories:100){
                repository{
                    owner{
                        login
                    }
                    nameWithOwner
                    url
                }
                contributions(first:100){
                    pageInfo{
                        hasNextPage
                    }
                    totalCount
                    nodes{
                        pullRequestReview{
                            url
                            pullRequest{
                                number
                            }
                        }
                    }
                }
            }
        }
    }
}",
  "variables": {
    "username": "HiroakiYo",
    "since": "2025-08-25T00:00:00.000Z",
    "until": "2025-09-01T00:00:00.000Z"
  }
}

